      self.init(complex: entityRef.complexEntity)
    }

    public convenience init?<S: SDAISelectType>(_ select: S?) { self.init(possiblyFrom: select) }
    public convenience init?(_ complex: SDAI.ComplexEntity?) { self.init(complex: complex) }


    //MARK: WHERE RULE VALIDATION (ENTITY)
    public override class func validateWhereRules(instance:SDAI.EntityReference?, prefix:SDAI.WhereLabel) -> [SDAI.WhereLabel:SDAI.LOGICAL] {
      guard let instance = instance as? Self else { return [:] }

      let prefix2 = prefix + " \(instance)"

      var result = super.validateWhereRules(instance:instance, prefix:prefix2)
      result[prefix2 + " .WHERE_wr1"] = _structured_dimension_callout.WHERE_wr1(SELF: instance)
      result[prefix2 + " .WHERE_wr2"] = _structured_dimension_callout.WHERE_wr2(SELF: instance)
      result[prefix2 + " .WHERE_wr3"] = _structured_dimension_callout.WHERE_wr3(SELF: instance)
      result[prefix2 + " .WHERE_wr4"] = _structured_dimension_callout.WHERE_wr4(SELF: instance)
      result[prefix2 + " .WHERE_wr5"] = _structured_dimension_callout.WHERE_wr5(SELF: instance)
      result[prefix2 + " .WHERE_wr6"] = _structured_dimension_callout.WHERE_wr6(SELF: instance)
      result[prefix2 + " .WHERE_wr7"] = _structured_dimension_callout.WHERE_wr7(SELF: instance)
      return result
    }


    //MARK: DICTIONARY DEFINITION
    public class override var entityDefinition: SDAIDictionarySchema.EntityDefinition { _entityDefinition }
    private static let _entityDefinition: SDAIDictionarySchema.EntityDefinition = createEntityDefinition()

    private static func createEntityDefinition() -> SDAIDictionarySchema.EntityDefinition {
      let entityDef = SDAIDictionarySchema.EntityDefinition(name: "STRUCTURED_DIMENSION_CALLOUT", type: self, explicitAttributeCount: 0)

      //MARK: SUPERTYPE REGISTRATIONS
      entityDef.add(supertype: eREPRESENTATION_ITEM.self)
      entityDef.add(supertype: eGEOMETRIC_REPRESENTATION_ITEM.self)
      entityDef.add(supertype: eDRAUGHTING_CALLOUT.self)
      entityDef.add(supertype: eSTRUCTURED_DIMENSION_CALLOUT.self)

      //MARK: ATTRIBUTE REGISTRATIONS
      entityDef.addAttribute(name: "CONTENTS", keyPath: \eSTRUCTURED_DIMENSION_CALLOUT.CONTENTS, 
        kind: .explicit, source: .superEntity, mayYieldEntityReference: true)
      entityDef.addAttribute(name: "NAME", keyPath: \eSTRUCTURED_DIMENSION_CALLOUT.NAME, 
        kind: .explicit, source: .superEntity, mayYieldEntityReference: false)
      entityDef.addAttribute(name: "DIM", keyPath: \eSTRUCTURED_DIMENSION_CALLOUT.DIM, 
        kind: .derived, source: .superEntity, mayYieldEntityReference: false)

      return entityDef
    }

